import React from 'react'; // View Library
import ReactDOM from 'react-dom'; // used for wibsites
import './index.css';
import Hello from './Hello'; // Creating our own Component and standard it should starts with uppercase letter
import reportWebVitals from './reportWebVitals';
import 'tachyons';


// Hello is the a module and greeting is prop
ReactDOM.render(
  <React.StrictMode>
    <Hello greeting={'Hello React Ninja'}/>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
